import Navbar from './Navbar';
import React from 'react';
import Tags from './Tags';
import ContentContainer from './ContentContainer';

function Bags() {
    return (<><Navbar />
        <ContentContainer>
            <div>{`Products>>Bags`}</div>
            <Tags /></ContentContainer></>);
}

export default Bags;
